ue identifier for the application password.'=>'Единствениот идентификатор за лозинката на апликацијата.','A UUID provided by the application to uniquely identify it. It is recommended to use an UUID v5 with the URL or DNS namespace.'=>'UUID обезбеден од апликацијата за уникатно да го идентификува. Се препорачува да се користи UUID v5 со URL или DNS именски простор.','The name of the application password.'=>'Името на лозинката на апликацијата.','The generated password. Only available after adding an application.'=>'Генерирана лозинка. Достапно само по додавање апликација.','The GMT date the application password was created.'=>'Датумот GMT кога е креирана лозинката на апликацијата.','The GMT date the application password was last used.'=>'Датумот GMT кога лозинката на апликацијата била последен пат користена.','The IP address the application password was last used by.'=>'IP-адресата од која лозинката на апликацијата била последен пат користена.','The provided password is an invalid application password.'=>'Обезбедената лозинка е неважечка лозинка на апликацијата.','Appearance'=>'Изглед','Enter your new password below or generate one.'=>'Внесете ја вашата нова лозинка подолу или генерирајте една.','Generate Password'=>'Генерирај лозинка','Save Password'=>'Зачувај лозинка','Sorry, you are not allowed to view the active theme.'=>'За жал, не ви е дозволено да ја гледате активната тема.','Theme not found.'=>'Темата не е пронајдена.','A named status for the theme.'=>'Именуван статус за темата.','Limit response to posts modified after a given ISO8601 compliant date.'=>'Ограничете го одговорот на објавите изменети по даден датум усогласен со ISO8601.','Limit response to posts modified before a given ISO8601 compliant date.'=>'Ограничете го одговорот на објавите изменети пред даден датум усогласен со ISO8601.','Term ID List'=>'Список за идентификација на термини','Match terms with the listed IDs.'=>'Поврзете ги условите со наведените лични карти.','Term ID Taxonomy Query'=>'Ба