hnical Issue'=>'[%s] Вашиот сајт има технички проблеми','Error not caused by a plugin or theme.'=>'Грешката не е предизвикана од додаток или тема.','Failed to store the error.'=>'Неуспешно зачувување на грешката.','Exit recovery mode link expired.'=>'Врската за излез од режимот за поправка е истечена.','Failed to exit recovery mode. Please try again later.'=>'Неуспешно излегување од режимот за поправка. Ве молиме обидете се повторно.','Edit gallery'=>'Уреди галерија','[%s] Admin Email Changed'=>'[%s] Промена на администраторската електронска пошта','[%s] Network Admin Email Change Request'=>'[%s] Барање за промена на електронската пошта на мрежниот администратор','[%s] Network Admin Email Changed'=>'[%s] Промена на електронска пошта на мрежниот администратор','Support'=>'Поддршка','Restore from Trash'=>'Врати од отпад','Move to Trash'=>'Премести во отпад','[%s] Login Details'=>'[%s] Детали за најава','https://wordpress.org/support/forums/'=>'https://wordpress.org/support/forums/','Error occurred on a non-protected endpoint.'=>'Настана грешка кај незаштитена крајна точка.','Please contact your host for assistance with investigating this issue further.'=>'Ве молиме контактирајте го вашиот хостинг за помош околу анализирање на проблемот.','Howdy!

Since WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Здраво!

Почнувајќи од WordPress 5.2 постои можност за декетирање на грешки настанати од додаток или тема за кои добивате автоматска електронска пошта.
###CAUSE###
Прво, посетете го вашиот веб-сајт (###SITEURL###) и проверете дали има видливи проблеми. Следно, посетете ја страницата каде е настаната грешка (###PAGEURL###) и проверете дали има видливи проблеми.

###SUPPORT###

Доколку вашиот сајт е расипан и не можете да пристапите до работната табла, WordPress нуди специјален режим за поправка. Тој овозможува безбедно најавување во работната табла и истражување за настаниот проблем.

###LINK###

За да го зачувате вашиот сајт безбеден, оваа врска ќе истече за ###EXPIRES###. Но, не грижете се за тоа. Нова врска ќе ви биде испратена доколу грешката се појави повторно и оваа врска е истечена.
###DEBUG###

